informacaoComplementar:
E notável a necessidade desta contratação, por se tratar de prestação de serviço essencial e imprescindível, uma vez que a energia elétrica é fundamental para o desenvolvimento das atividades laborais e para a prestação de serviço à classe contabilista, Considerando Que no Estado de Roraima há apenas uma prestadora de serviços de fornecimento de energia elétrica;

Que este tipo de serviço, em regra, é prestado em regime de exclusividade, sendo a tarifa cobrada definida pelo Poder Público, inexistindo possibilidade de competição e a contratação desses serviços ocorre sempre com a mesma pessoa jurídica, no caso, a RORAIMA ENERGIA S. A.

Que a RORAIMA ENERGIA S. A. é a única competente no município de Boa Vista apta ao fornecimento de energia elétrica, o que impossibilita a realização do procedimento licitatório;

Que a contratação ocorre basicamente, nos mesmos termos, ademais trata-se de serviço de duração continuada, imprescindível ao funcionamento do Conselho Regional de Contabilidade de Roraima.
